function getTimeDiffInSeconds({ date }) {
    const now = new Date();
    const targetDate = new Date(date);
    const diffInSeconds = (targetDate.getTime() - now.getTime()) / 1000;
    return Math.abs(Math.round(diffInSeconds));
}
